	private List<Dealer> parseMapJSON(String json) {

		List<Dealer> items = new ArrayList<Dealer>();

		try {
			JSONObject jsonObject = new JSONObject(json);
			Log.i(MainActivity.class.getName(), "Number of entries "
					+ jsonObject.length());
			Iterator keys = jsonObject.keys();
			while (keys.hasNext()) {
				String id = keys.next().toString();
				JSONObject obj = jsonObject.getJSONObject(id);
				Dealer i = new Dealer();
				i.setId(id);
				i.setName(obj.getString("n"));
				String coord = obj.getString("c");
				coord = coord.substring(1, coord.length() - 1);
				String[] c = coord.split(",");
				i.setLat(Double.valueOf(c[0]));
				i.setLon(Double.valueOf(c[1]));
				items.add(i);
			}
		} catch (Exception e) {
			e.printStackTrace();
		}
		return items;
	}

	private Dealer parseDealerJSON(String json) {

		Dealer item = new Dealer();

		try {
			JSONObject jsonObject = new JSONObject(json);
			item.setId(jsonObject.getString("id"));
			item.setName(jsonObject.getString("name"));
			item.setStreetNo(jsonObject.getString("address"));
			item.setCity(jsonObject.getString("city"));
			item.setZip(jsonObject.getString("zip"));
			item.setPhone(jsonObject.getString("phone"));
			item.setWeb(jsonObject.getString("www"));
		} catch (Exception e) {
			e.printStackTrace();
		}
		return item;
	}

